import React from "react";
export const Footer = () => {
  return (
    <div>
      <footer className=" ">
        <div className="h-full width-full bg-gradient-to-r from-slate-900 via-red-900 to-slate-900 text-zinc-100 border-t-2 border-zinc-100 py-2 ">
          <p className="text-center text-base">&copy; 2024 Career Crafter. All rights reserved.</p>
        </div>
      </footer>
    </div>
  );
};
